import React, {FC} from "react";
import '../App.css'
import OrdersList from "../components/OrdersList";

const Basket: FC = () => {
    return (
        <div>
            <div className="header">HEADER OF PRODUCT BASKET PAGE</div>
            <div>ТУТ БУДЕ РЕЛИЗОВАНА КОРЗИНА</div>
            <OrdersList />
            <div className="footer">FOOTER</div>
        </div>
    );
};

export default Basket;
